import { type } from "os";
import Container from "react-bootstrap/Container";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";
import "bootstrap/dist/css/bootstrap.min.css";
import React from "react";
import {
  MDBContainer,
  MDBCol,
  MDBRow,
  MDBBtn,
  MDBIcon,
  MDBInput,
  MDBCheckbox,
} from "mdb-react-ui-kit";
import { Button, Form } from "react-bootstrap";

export interface iShema {
  name: "dark1" | "dark2" | "light" | "def";
}
type tMenu = {
  name: string;
  linkComp: string;
};

const listMenu: tMenu[] = [
  { name: "/MyApp", linkComp: "Home" },
  { name: "/Page2", linkComp: "Features" },
  { name: "/Login", linkComp: "Login" },
];

const Menu = () => {
  return listMenu.map((item) => {
    return <Nav.Link href={item.name}>{item.linkComp}</Nav.Link>;
  });
};

function ColorSchemesExample(props: iShema) {
  const testName: string = "Home";

  const project = () => {
    switch (props.name) {
      case "dark1":
        return (
          <Navbar bg="dark" data-bs-theme="dark">
            <Container>
              <Navbar.Brand href="#home">Navbar</Navbar.Brand>
              <Nav className="me-auto">{Menu()}</Nav>
            </Container>
            <Form color="light" data-bs-theme="light">
              <Form.Check // prettier-ignore
                type="switch"
                id="custom-switch"
                label="Check this switch"
              />
            </Form>
            <Button
              variant="dark"
              style={{ display: "flex", justifyContent: "right" }}
            >
              Login
            </Button>
          </Navbar>
        );
      case "dark2":
        return (
          <Navbar bg="primary" data-bs-theme="dark">
            <Container>
              <Navbar.Brand href="#home">Navbar</Navbar.Brand>
              <Nav className="me-auto">
                {Menu()}
                {/* <Nav.Link href="#home">Home</Nav.Link>
                <Nav.Link href="#features">Features</Nav.Link>
                <Nav.Link href="#pricing">Pricing</Nav.Link> */}
              </Nav>
            </Container>
            <Button
              variant="info"
              style={{ display: "flex", justifyContent: "right" }}
            >
              Login
            </Button>
          </Navbar>
        );
      case "light":
        return (
          <Navbar bg="light" data-bs-theme="light">
            <Container>
              <Navbar.Brand href="#home">Navbar</Navbar.Brand>
              <Nav className="me-auto">
                {Menu()}
                {/* <Nav.Link href="#home">Home</Nav.Link>
                <Nav.Link href="#features">Features</Nav.Link>
                <Nav.Link href="#pricing">Pricing</Nav.Link> */}
              </Nav>
            </Container>
            <Form >
              <Form.Check // prettier-ignore
                type="switch"
                id="custom-switch"
                label="Check this switch"
              />
            </Form>
            <Button
              variant="light"
              style={{ display: "flex", justifyContent: "right" }}
            >
              Login
            </Button>
          </Navbar>
        );
      default:
        return <h1>No project match</h1>;
    }
  };
  return (
    <>
      <div>{project()} </div>
    </>
  );
}

export default ColorSchemesExample;
